import React, { useEffect } from "react";
import ConfirmModal from "./ConfirmModal";
import { inject, observer } from "mobx-react";

const Modals = inject("PageStore")(
  observer(({ PageStore }) => {
    return <ConfirmModal {...PageStore.modalData} />;
  })
);

export default Modals;
